import "./topbar.css"
import axios from "axios"
import { useState } from "react"
import { useEffect } from "react";




export default function TopBar() {
    const [user, setUser] = useState([]);
    useEffect(()=>{
        const fetchUser = async () => {
            const res = await axios.get("/books")
            // setUser(res.data)
            console.log("hello", res);
            setUser(res.data)

        }
        fetchUser();
    },[] )
  return (
    <div>

      return (
    <div>
    <table>
    <thead>
          <tr>
            <th colSpan="4">Metro Areas by State</th>
          </tr>
          <tr>
            <th>Book Name</th>
            <th>Author</th>
            <th>Edition</th>
            <th>price</th>
          </tr>
          </thead>
          </table>
      <table> {user.map((c) => (
       
          <tr> 
          <td>{c.title}</td>
          <td>{c.author}</td>
          <td>{c.edition}</td>
          <td>{c.price}</td>
         
         
      
         
        
          </tr>
        
      
     

      ))}
      </table>
    </div>
  )
    </div>
  )

  
}
